using ShineEngine;

/// <summary>
/// 事务状态(generated by shine)
/// </summary>
public class WorkState
{
	/// <summary>
	/// 空闲
	/// </summary>
	public const int None=0;
	
	/// <summary>
	/// 执行中
	/// </summary>
	public const int Doing=1;
	
	/// <summary>
	/// 已完成
	/// </summary>
	public const int Completed=2;
	
	/// <summary>
	/// 执行失败
	/// </summary>
	public const int Failed=3;
	
	/// <summary>
	/// 长度
	/// </summary>
	public static int size=4;
	
}
